import React, {PureComponent} from 'react';
import Post from "./Post/Post";
import LoginPostFormRedux from "./FormPost";

class MyPost extends PureComponent {

    componentDidMount() {
        setTimeout(()=>{
            this.setState({a:12})
        },3000)
    }

    render() {
        console.log('render')
        console.log(this.props)
        let PostMass = this.props.posts.map(p => <Post message={p.text} key={p.id} like={p.like}/>)
        let addPosts = (formData) => {
            this.props.onaddDialogs(formData.post)
        }
        return (
            <div>
                <div>
                    <LoginPostFormRedux onSubmit={addPosts}/>
                </div>
                {PostMass}
            </div>
        );
    }
}

export default MyPost;
